from waste_collection_schedule.service.RemondisDe import (RemondisDe, getAllCitiesAndDistricts, filterOnlyCities)
from waste_collection_schedule import Collection

def DOC_INFO():
    cities = list(filterOnlyCities(getAllCitiesAndDistricts()))
    cities.sort()
    waste_types = list(ICON_MAP.keys())
    waste_types.sort()
    return {"cities": cities, "waste_types": waste_types}

#_types = set()

class Source:
    def __init__(self, city, postalCode, street, streetNumber):
        self._service = RemondisDe(city, postalCode, street, streetNumber)

    def fetch(self):
        sched = self._service.fetchSchedule()

        entries = []
        for bin in sched:
            icon = ICON_MAP.get(bin)
            for date in sched[bin]['dates']:
                #if not bin in _types:
                    #_types.add(bin)
                    #print(f"New type: {bin}")
                entries.append(
                    Collection(
                        date=date,
                        t=bin,
                        icon=icon,
                        picture=sched[bin]['image'],
                    )
                )
        return entries

